import React from 'react';
import { Menu, User, Github, Download } from 'lucide-react';

// Assuming you have these components
import NavBar from '../components/';
import Footer from './Footer';

const SignUpForm = () => (
  <div className="bg-white bg-opacity-80 rounded-lg p-8 w-full max-w-md">
    <h2 className="text-2xl font-semibold text-center mb-6">Register</h2>
    <form className="space-y-4">
      <input type="text" placeholder="First Name" className="w-full p-2 rounded border" />
      <input type="text" placeholder="Last Name" className="w-full p-2 rounded border" />
      <input type="text" placeholder="Username" className="w-full p-2 rounded border" />
      <input type="email" placeholder="Email Address" className="w-full p-2 rounded border" />
      <input type="text" placeholder="Location" className="w-full p-2 rounded border" />
      <input type="password" placeholder="Password" className="w-full p-2 rounded border" />
      <input type="password" placeholder="Confirm Password" className="w-full p-2 rounded border" />
      <button type="submit" className="w-full p-2 bg-purple-500 text-white rounded hover:bg-purple-600 transition-colors">
        Create Account
      </button>
    </form>
    <p className="text-center mt-4 text-sm text-gray-600 hover:underline cursor-pointer">
      Forgot your password?
    </p>
  </div>
);

const SignUpPage = () => {
  return (
    <div className="min-h-screen flex flex-col bg-gradient-to-br from-pink-300 to-purple-200 bg-cover bg-center">
      {/* Header */}
      <header className="p-4 flex justify-between items-center bg-white bg-opacity-30">
        <Menu className="text-gray-700" size={24} />
        <div className="text-2xl font-bold">≽^•⩊•^≼</div>
        <div className="flex items-center space-x-2">
          <button className="px-4 py-2 bg-pink-200 rounded-full text-sm">Login</button>
          <User className="text-gray-700" size={24} />
          <Download className="text-gray-700" size={24} />
        </div>
      </header>

      {/* Main content */}
      <main className="flex-grow flex justify-center items-center p-4">
        <SignUpForm />
      </main>

      {/* Footer */}
      <footer className="p-4 flex justify-between items-center bg-white bg-opacity-30">
        <div className="text-2xl font-bold">≽^•⩊•^≼</div>
        <div className="flex items-center space-x-4 text-sm">
          <span>About Us</span>
          <Github size={20} />
          <span>Download</span>
          <User size={20} />
          <Download size={20} />
        </div>
      </footer>
    </div>
  );
};

export default SignUpPage;
